    playbackData.comments = {"ev-0":[{"id":"commentId-0","displayCommentEvent":{"id":"ev-0","timestamp":1599236366361,"createdByDevGroupId":"devGroupId-1","eventSequenceNumber":0,"permanentRelevance":"never relevant","type":"CREATE DIRECTORY","directoryId":"dirId-0","directoryPath":"/","parentDirectoryId":null},"developerGroupId":"devGroupId-1","timestamp":1608162372687,"commentText":"There are a couple of ways to change how a loop works. <font face=\"Courier\">continue</font> is a keyword that causes a jump back to the loop test. <font face=\"Courier\">break</font> is a keyword that causes the loop to be exited.","selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"","linesBelow":"","currentFilePath":"","viewableBlogText":"","commentTags":[],"questionCommentData":null,"commentTitle":""}],"ev-159":[{"id":"commentId-1","displayCommentEvent":{"id":"ev-159","timestamp":1505392741354,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":159,"type":"INSERT","fileId":"fileId-0","character":" ","previousNeighborId":"ev-158","lineNumber":11,"column":4,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1608162533468,"commentText":"Here I am printing the numbers 1-30 in a simple <font face=\"Courier\">for</font> loop.","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"for(int i = 1;i <= 30;i++) \n    { \n        cout<<i<<endl; \n    }","startRow":6,"startColumn":4,"endRow":9,"endColumn":5}],"imageURLs":["media/images/1608162515878-01.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"2","linesBelow":"3","currentFilePath":"/breakContinue.cpp","viewableBlogText":"int main() \n{ \n    for(int i = 1;i <= 30;i++) \n    { \n        cout<<i<<endl; \n    } \n     \n    return 0; \n}","commentTags":["image"],"questionCommentData":null,"commentTitle":""}],"ev-246":[{"id":"commentId-2","displayCommentEvent":{"id":"ev-246","timestamp":1505393035458,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":246,"type":"INSERT","fileId":"fileId-0","character":" ","previousNeighborId":"ev-245","lineNumber":13,"column":8,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609200803949,"commentText":"If the counter <font face=\"Courier\">i</font> is an even number then I will <font face=\"Courier\">continue</font> the loop.<font face=\"Courier\"> continue</font> is kind of like jumping to the end of the loop and skipping all the statements in between.&nbsp;<div><br></div><div>In other words, the flow of control jumps to the ending curly brace of the loop body, the update statement is executed, and the flow jumps back to the loop test at the top of the loop.</div><div><br></div><div>Everything below the <font face=\"Courier\">continue</font> in the loop body will be skipped (this is true in a <font face=\"Courier\">while</font> loop also). So, none of the even numbers will get printed because the flow of control never gets to the <font face=\"Courier\">cout</font> when <font face=\"Courier\">i</font> is even.</div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"if(i % 2 == 0) \n        { \n            continue; \n        }","startRow":8,"startColumn":8,"endRow":11,"endColumn":9}],"imageURLs":["media/images/1608162770534-02.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"2","linesBelow":"3","currentFilePath":"/breakContinue.cpp","viewableBlogText":"    for(int i = 1;i <= 30;i++) \n    { \n        if(i % 2 == 0) \n        { \n            continue; \n        } \n         \n        cout<<i<<endl; \n    } ","commentTags":["image"],"questionCommentData":null,"commentTitle":""}],"ev-329":[{"id":"commentId-3","displayCommentEvent":{"id":"ev-329","timestamp":1505393311771,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":329,"type":"INSERT","fileId":"fileId-0","character":" ","previousNeighborId":"ev-328","lineNumber":13,"column":8,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609200879453,"commentText":"If the counter <font face=\"Courier\">i</font> is exactly equal to 19 then I use the <font face=\"Courier\">break</font> keyword. When the flow of control reaches a <font face=\"Courier\">break</font> it causes an immediate exit from the loop body. The loop test is NOT evaluated and the update statement is NOT executed- the flow of control jumps right outside the loop body.<div><br></div><div>When <font face=\"Courier\">i</font> is equal to 19 the loop breaks and none of the numbers past 17 (the last odd number printed) will be displayed.</div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"if(i == 19) \n        { \n            break; \n        }","startRow":8,"startColumn":8,"endRow":11,"endColumn":9}],"imageURLs":["media/images/1608162928373-03.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"2","linesBelow":"8","currentFilePath":"/breakContinue.cpp","viewableBlogText":"    for(int i = 1;i <= 30;i++) \n    { \n        if(i == 19) \n        { \n            break; \n        } \n         \n        if(i % 2 == 0) \n        { \n            continue; \n        } \n \n        cout<<i<<endl; \n    } ","commentTags":["image"],"questionCommentData":null,"commentTitle":""}],"ev-388":[{"id":"commentId-4","displayCommentEvent":{"id":"ev-388","timestamp":1505394535296,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":388,"type":"INSERT","fileId":"fileId-0","character":"!","previousNeighborId":"ev-187","lineNumber":14,"column":18,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609200908287,"commentText":"I very rarely, if ever, use <font face=\"Courier\">continue</font>. Instead, I usually use <font face=\"Courier\">if</font> statements in the loop to avoid them. This seems easier to read and reason about then using <font face=\"Courier\">continue</font>.<div><br></div><div><font face=\"Courier\">continue</font> can be avoided here by changing the <font face=\"Courier\">if</font> to see if the number is NOT even and printing it when this is <font face=\"Courier\">true</font>. This produces the same output.</div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"if(i % 2 != 0) \n        { \n            cout<<i<<endl; \n        }","startRow":13,"startColumn":8,"endRow":16,"endColumn":9}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"7","linesBelow":"1","currentFilePath":"/breakContinue.cpp","viewableBlogText":"    for(int i = 1;i <= 30;i++) \n    { \n        if(i == 19) \n        { \n            break; \n        } \n \n        if(i % 2 != 0) \n        { \n            cout<<i<<endl; \n        } \n    } ","commentTags":[],"questionCommentData":null,"commentTitle":""}],"ev-464":[{"id":"commentId-5","displayCommentEvent":{"id":"ev-464","timestamp":1505394585777,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":464,"type":"INSERT","fileId":"fileId-0","character":"9","previousNeighborId":"ev-463","lineNumber":7,"column":36,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609201123995,"commentText":"<font face=\"Courier\">break</font> can be avoided too by including an additional condition in the loop test. Here I change the loop test to check if the counter is in the right range AND if the counter is not equal to 19. When i is 19 this will evaluate to:&nbsp;<div><br></div><div><font face=\"Courier\">true &amp;&amp; false</font></div><div><br></div><div>which, of course, is <font face=\"Courier\">false</font> and the loop will terminate without printing the rest of the numbers. <br></div><div><br></div><div>However, I find this code <i>harder</i> to read than the original so I do use 'break' all the time so I'll change the code back next.</div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":" && i != 19","startRow":6,"startColumn":25,"endRow":6,"endColumn":36}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"6","currentFilePath":"/breakContinue.cpp","viewableBlogText":"    for(int i = 1;i <= 30 && i != 19;i++) \n    { \n        if(i % 2 != 0) \n        { \n            cout<<i<<endl; \n        } \n    } ","commentTags":[],"questionCommentData":null,"commentTitle":""}],"ev-540":[{"id":"commentId-6","displayCommentEvent":{"timestamp":1505395054365,"type":"INSERT","eventSequenceNumber":540,"createdByDevGroupId":"devGroupId-2","id":"ev-540","fileId":"fileId-0","character":"NEWLINE","previousNeighborId":"ev-539","lineNumber":12,"column":11,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609201441822,"commentText":"Here is the final version.<br>","selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"3","linesBelow":"3","currentFilePath":"/breakContinue.cpp","viewableBlogText":"","commentTags":["question"],"questionCommentData":{"allAnswers":["True","False"],"correctAnswer":"False","question":"True or false, a break can be used in an if statement (not in a loop) to immediately exit the body of the if.","explanation":""},"commentTitle":""}]};
